    render() {
        return (
            <div style ={{display :'flex',padding:'0.5',marginLeft:'3rem',alignItems:'center'}}>
                <h1 style={{marginTop:'1.3rem'}}>Movies App</h1>
                <h2 style = {{marginLeft:'3rem', marginTop:'1.5rem'}}>Favourites</h2>
               
            </div>
        )
    }
}
